import { technologies } from "../Data/technologies";

function Tech() {
  const list = technologies.map((tech) => {
    let src = require(tech.symbol);
    console.log(src);
    return (
      <li key={tech.name}>
        <img src={require(`${tech.symbol}`)}></img>
        <h5 >{tech.name}</h5>
      </li>
    );
  });
  console.log(list);
  return (
    <div>
      <h3>Technologies</h3>
      <ul>{list}</ul>
    </div>
  );
}

export default Tech;
